import React from "react"

function Karta(props){
    return(
        <div id="idKarta">
            <p>Film: {props.state.projekcija.film}</p>
            <p>Vreme prikazivanja filma: {props.state.projekcija.datumVremePrikazivanja}</p>
        </div>
    )
}

export default Karta
